function sonics = import_sonics(filename, startRow, endRow)
%IMPORTFILE1 Import numeric data from a text file as a matrix.
%   SONICS = IMPORTFILE1(FILENAME) Reads data from text file FILENAME for
%   the default selection.
%
%   SONICS = IMPORTFILE1(FILENAME, STARTROW, ENDROW) Reads data from rows
